script: |
  super -f tsv -I q2573.sql | sort > q2573.out

vector: true

inputs:
  - name: q2573.sql
    data: |
      SELECT col2 / - + col2 AS col1 FROM tab1 AS cor0 WHERE NOT col1 + + - col1 IN ( col0 + + - col2 );
  - name: tab1

outputs:
  - name: q2573.out
    data: |
      -1
      -1
      -1
